// PaymentSuccess.js

import React from "react";

const PaymentSuccess = () => (
  <div style={styles.container}>
    <h1>Payment Successful!</h1>
    <p>Thank you for your purchase.</p>
  </div>
);

const styles = {
  container: {
    padding: "50px",
    textAlign: "center",
    fontFamily: "Arial, sans-serif",
  },
};

export default PaymentSuccess;
